import circle from "./photo/Group 1.svg"
import './App.css';
import arrow from "./photo/Arrow 1.svg"
import Tilt from 'react-parallax-tilt';
import { motion } from "framer-motion"
function App() {
  return (
    <div className="body">

        <h1 className="back-page">CREATIVE NEW DESIGN</h1>

     <header className="header">
       <p className="logo">logo</p>
         <div className="links">
             <a href="#">menu</a>
             <a href="#">creative</a>
             <a href="#">contact</a>
         </div>
     </header>

        <div className="main-block-page">

        <div className="main-page">

            <div className="main-box">
                <motion.h1
                    whileHover={{scale: 1.1}}
                >CREATIVE NEW DESIGN</motion.h1>
                <Tilt>
                <motion.img
                    whileHover={{scale: 1.1}}
                    style={{
                    height: 300,
                }
                }
                    src={circle}/>
                </Tilt>
            </div>

        </div>


        <div className="btn-scroll">
            <p>Scroll Down</p>
            <img src={arrow}/>
        </div>
    </div>
    </div>
  );
}

export default App;
